const struct morse_regdomain *morse_reg_alpha_lookup(const char *alpha)
{
	int i;

	if (!alpha)
		return NULL;
	for (i = 0; i < ARRAY_SIZE(mors_regions); i++)
		if (!strncmp(mors_regions[i]->alpha2, alpha, strlen(alpha)))
			return mors_regions[i];
	return NULL;
}
